import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [search, setSearch] = useState("");

  const data = [
    { name: "Item 1", category: "Category A", description: "Description 1" },
    { name: "Item 2", category: "Category B", description: "Description 2" },
    { name: "Item 3", category: "Category A", description: "Description 3" },
  ];

  const filteredData = data.filter((item) =>
    item.name.toLowerCase().trim().includes(search.toLowerCase().trim()) ||
    item.category.toLowerCase().trim().includes(search.toLowerCase().trim())
  );

  console.log("Filtered Data:", filteredData); // Debugging

  return (
    <div>
      <h1>Item Dashboard</h1>
      <input
        type="text"
        placeholder="Search by name or category..."
        value={search}
        onChange={(e) => {
          console.log("Search Input:", e.target.value); // Debugging
          setSearch(e.target.value);
        }}
      />
      <table border="1">
        <thead>
          <tr>
            <th>Name</th>
            <th>Category</th>
            <th>Description</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.length > 0 ? (
            filteredData.map((item, index) => (
              <tr key={index}>
                <td>{item.name}</td>
                <td>{item.category}</td>
                <td>{item.description}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3" style={{ textAlign: "center", fontWeight: "bold" }}>
                No items found
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default App;
